import Card from "react-bootstrap/Card";


const News = () => (

        <div className="contact">
            <div
                className="leftSide"
                style={{ backgroundImage: `url(${image1})` }}
            ></div>
            <div className="rightSide">
                <h1> Taking Your GDG Gift</h1>
                <h3></h3>



            </div>
        </div>
)
;

export default News;
